import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root',
})
export class LabSeqService {
  private baseUrl = 'http://localhost:8080/labseq';

  constructor(private http: HttpClient) {}

  async getLabSeqValue(n: BigInt): Promise<BigInt> {
    try {
      const result = await this.http.get<number | undefined>(`${this.baseUrl}/${n.toString()}`).toPromise();

      if (result === undefined) {
        throw new Error('Value is undefined');
      }

      if (!Number.isFinite(result)) {
        throw new Error(`Invalid LabSeq API response. Expected a finite number, but received: ${result}`);
      }

      // Log the response here
      console.log('LabSeq API Response:', result);

      return BigInt(result);
    } catch (error) {
      // Handle errors as needed
      console.error('Error fetching lab sequence value:', error);
      throw error;
    }
  }
}
